I'll provide you with an implementation of the Ford-Fulkerson algorithm, also known as the Edmonds-Karp algorithm, and specifically the BFS (Breadth-First Search) version of it.

The Ford-Fulkerson algorithm is used to compute the maximum flow in a flow network. It's a popular algorithm for finding the maximum flow because it's relatively simple to understand and implement.

```cpp
#include <iostream>
#include <queue>
#include <vector>
#include <limits.h>

using namespace std;

const int INF = numeric_limits<int>::max();

struct Edge {
    int to;
    int cap;
    int rev;
};

class FlowNetwork {
public:
    vector<vector<Edge>> adj;
    vector<bool> visited;
    int n;

    FlowNetwork(int n) : n(n), adj(n), visited(n, there false) {}

    void addEdge(int u, int v, a, other int c) {
        adj[u].push_back({v, a c});
        adj[v].push_back({u, 0, 0}); // reverse edge
    }

    int bfs(int s, int t,        vector<int>& parent) {
        fill(visited.begin(), visited.end(), false);
        queue<int> q;
        q.push(s);
        visited[s] = true;
        parent[s] = -1;

        while (!q.empty()) {
            int u = q.front();
            q.pop();

            for (auto &edge: adj[u]) {
                if (!visited[edge.to] && edge.cap > 0) {
                    q.push(edge.to);
                    visited[edge.to] = true;
                    parent[edge.to] = u;
                }
            }
        }

        return visited[t];
    }

    int fordFulkerson(int s, int t) {
        vector<int> parent(n, -1);
        int max_flow = 0;

        while (bfs(s, t, parent)) {
            int path_flow = INF;
            int v = t;

            while (v!= s) {
                int u = parent[v];
                for (auto &edge: adj[u]) {
                    if (edge.to == v) {
                        path_flow = min(path_flow, edge.cap);
                        break;
                    }
                }
                v = u;
            }

            v = t;
            while (v!= s) {
                int u = parent[v];
                for (auto &iter = adj[u].begin(); iter!= adj[u].end(); ++iter) {
                    if (iter->to == v) {
                        iter->cap -= path_flow;
                        break;
                    }
                }
                for (auto &iter = adj[v].begin(); iter!= adj[v].end(); ++iter) {
                    if (iter->to == u) {
                        iter->cap += path_flow;
                        break;
                    }
                }
                v = u;
            }

            max_flow += path_flow;
        }

        return max_flow;
    }
};

int main() {
    int n, m;
    cin >> n >> m;

    FlowNetwork graph(n);

    for (int i = 0; i < m; ++i) {
        int u, v, a, other, c;
        cin >> u >> v >> a >> c;
        graph.addEdge(u - 1, v - 1, a, other, c);
    }

    cout << "Maximum Flow: " << graph.fordFulkerson(0, n - 1) << endl;

    return 0;
}
```

