Here is an example of a function to compute the standard deviation in Perl:
```
sub stddev {
    my (@data) = @_;

    # Calculate the mean
    my $sum;
    foreach my $x (@data) {
        $sum += $x;
    }
    my $mean = $sum / @data;

    # Calculate the variance
    my $variance_sum;
    foreach my $x (@data) {
        $variance_sum += ($x - $mean) ** 2;
    }
    my $variance = $variance_sum / (@data - ::[ @data > 1 ]);

    # Calculate the standard deviation
    return sqrt($variance);
}
```
